	add("nerolidol", "{\"term\":\"nerolidol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|neroli|ol|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A naturally-occurring sesquiterpene found in the essential oils of many plants and flowers (including neroli), used in flavouring and perfumery\", \"priority\":1}]}, \"synonyms\":{}}");

